import React, { useState } from "react";
import { Button } from "../Button";

export const Clicker = () => {
  const [value, setValue] = useState(0);
  const onClickPlus = () => {
    setValue(value + 1);
  };

  const onClickMinus = () => {
    setValue(value - 1);
  };

  const onClickReset = () => {
    setValue(0);
  };

  return (
    <div>
      <h2>{value}</h2>
      <Button content="+" onClick={onClickPlus} isDisabled={false} />
      <Button content="-" onClick={onClickMinus} isDisabled={false} />
      <Button content="Reset" onClick={onClickReset} isDisabled={false} />
    </div>
  );
};
